import React from 'react';
import { Player } from 'video-react';
import kayaking from '../../../../assets/video/kingfisher-kayaking-compressed.mp4'

function Video(){
  const videoSrc = kayaking
  
  return (
    <Player>
      <source src={videoSrc} />
    </Player>
  );
};

export default Video;
